import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Sidebar />
        <AdministratorOrders />
      </Router>

    </div>
  );
}

export default App;
